pragma solidity >=0.5.1;

import "openzeppelin-solidity/contracts/token/ERC721/ERC721Full.sol";
import "openzeppelin-solidity/contracts/token/ERC721/ERC721Mintable.sol";
import "openzeppelin-solidity/contracts/math/SafeMath.sol";
import "openzeppelin-solidity/contracts/drafts/Counters.sol";
//import {HardwareId} from "./HardwareId.sol";

contract DeviceManager is ERC721Full, ERC721Mintable {
    using SafeMath for uint256;
    using Counters for Counters.Counter;

    mapping (uint256 => address) private _hardwareId_of_deviceId;
    mapping (address => uint256) private _deviceId_of_hardwareId;
    mapping (uint256 => string) private _uris_of_deviceId;
    mapping (uint256 => uint256[]) private _parts_of_deviceId;
    mapping (uint256 => uint256) private _assembly_of_deviceId;
    Counters.Counter private counter = Counters.Counter(0);

    constructor() ERC721Full("Device", "DEVICE") public {}

    function get_hardwareId(uint256 device_id) public view returns(address) {
        require(device_id!=0,"given device id is zero.");
        return _hardwareId_of_deviceId[device_id];
    }

    function get_deviceId_by_hardwareId(address hardwareId) public view returns(uint256) {
        require(hardwareId!=address(0),"given device id is zero.");
        return _deviceId_of_hardwareId[hardwareId];
    }

    function get_uri(uint256 device_id) public view returns(string memory) {
        require(device_id!=0,"given device id is zero.");
        return _uris_of_deviceId[device_id];
    }

    function get_parts(uint256 device_id) public view returns(uint256[] memory) {
        require(device_id!=0,"given device id is zero.");
        return _parts_of_deviceId[device_id];
    }

    function get_assembly(uint256 device_id) public view returns(uint256) {
        require(device_id!=0,"given device id is zero.");
        return _assembly_of_deviceId[device_id];
    }

    function produce(address hardwareId, string memory uri) public returns(uint256) {
        require(_deviceId_of_hardwareId[hardwareId] == 0, "the given hardware ID already exists");
        uint256 device_id = _update_id();
        require(device_id!=0,"token id is zero.");
        bool success = safeMint(msg.sender,device_id);
        require(success,"fail to mint device nft.");
        _hardwareId_of_deviceId[device_id] = hardwareId;
        _deviceId_of_hardwareId[hardwareId] = device_id;
        _uris_of_deviceId[device_id] = uri;
        _setTokenURI(device_id, uri);
        return device_id;
    }

    function assemble(uint256[] memory parts, uint256 hardwareId_index, string memory uri) public returns(uint256) {
        uint len = parts.length;
        require(len>0,"the number of parts is zero.");
        require(hardwareId_index>=0&&hardwareId_index<len,"invalid hardwareId index.");
        address myself = address(this);
        uint i;
        for(i=0;i<len;i++){
            require(parts[i]!=0,"part token id is zero.");
            require(_assembly_of_deviceId[parts[i]]==0,"the device is used for other assembled device");
            safeTransferFrom(msg.sender, myself, parts[i]);
            require(msg.sender != ownerOf(parts[i]) && myself == ownerOf(parts[i]),"fail to transfer part device nft.");
        }
        address new_hardwareId = _hardwareId_of_deviceId[parts[hardwareId_index]];
        uint256 device_id = produce(new_hardwareId,uri);
        require(device_id!=0,"assembled token id is zero.");
        require(msg.sender == ownerOf(device_id),"fail to produce assembled device nft.");
        _parts_of_deviceId[device_id] = parts;
        for(i=0;i<len;i++){
            _assembly_of_deviceId[parts[i]] = device_id;
        }
        return device_id;
    }

    function disassemble(uint256 device_id) public returns(uint256[] memory){
        require(device_id!=0,"given device id is zero.");
        require(_assembly_of_deviceId[device_id]==0,"the device is used for assembled device");
        address myself = address(this);
        _remove(device_id);
        uint256[] memory parts = _parts_of_deviceId[device_id];
        uint len = parts.length;
        uint i;
        for(i=0;i<len;i++){
            require(parts[i]!=0,"part token id is zero.");
            safeTransferFrom(myself, msg.sender, parts[i]);
            require(myself != ownerOf(parts[i]) && msg.sender == ownerOf(parts[i]),"fail to transfer part device nft.");
        }
        _reset(device_id);
        _parts_of_deviceId[device_id] = new uint256[](0);
        for(i=0;i<len;i++){
            _assembly_of_deviceId[parts[i]] = 0;
        }
        return parts;
    }

    function disposal(uint256 device_id) public {
        require(device_id!=0,"given device id is zero.");
        require(_assembly_of_deviceId[device_id]==0,"the device is used for assembled device");
        if(_parts_of_deviceId[device_id].length==0) {
            _remove(device_id);
            _reset(device_id);
        }
        else {
            disassemble(device_id);
            disposal(device_id);
        }
    }

    function _remove(uint256 device_id) private {
        super._burn(msg.sender,device_id);
        require(ownerOf(device_id) != msg.sender && ownerOf(device_id) == address(0),"fail to burn device nft.");
    }

    function _reset(uint256 device_id) private {
        address hardwareId = _hardwareId_of_deviceId[device_id];
        _hardwareId_of_deviceId[device_id] = address(0);
        _deviceId_of_hardwareId[hardwareId] = 0;
        _uris_of_deviceId[device_id] = '';
    }

    function _update_id() private returns(uint256) {
        counter.increment();
        return counter.current();
    }
}
